import React from 'react';
import PropTypes from 'prop-types';

const propTypes = {};

const defaultProps = {};

/**
 * 
 */

const navMainCont = {
    backgroundColor: "black",
    padding: "2px",
    color: "#979494",
    display: "flex",
    justifyContent: "space-between"
}

const navList = {
    display: "flex"

}

const navListItem = {
    marginRight: "0.5em",
    padding: "1rem",
    border: "1px white solid"
}


const NavBar = () => {
    return <nav style={navMainCont}>
        <div>
            <h2 style={navListItem}>DT</h2>
        </div>
        <div style={navList}>
            <h4 style={navListItem}>Home</h4>
            <h4 style={navListItem}>About</h4>
            <h4 style={navListItem}>Projects</h4>
            <h4 style={navListItem}>Contacts</h4>
            <h4 style={navListItem}>Resume</h4>
        </div>

        <div class="dropdown">
            <a class="btn btn-secondary dropdown-toggle" href="#" role="button" id="dropdownMenuLink" data-bs-toggle="dropdown" aria-expanded="false">
                Dropdown link
  </a>

            <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink">
                <li><a class="dropdown-item" href="#">Action</a></li>
                <li><a class="dropdown-item" href="#">Another action</a></li>
                <li><a class="dropdown-item" href="#">Something else here</a></li>
            </ul>
        </div>
    </nav>;
}

NavBar.propTypes = propTypes;
NavBar.defaultProps = defaultProps;
// #endregion

export default NavBar;
